import React from 'react'

const Form = () => {

    return (
        <form action="#" style={{marginLeft: "50px"}}>
        
        <div className="form-inline" style={{marginBottom: '10px'}}>
        <label for="Product" style={{marginLeft: '100px'}}>Product Name <span style={{color: 'red'}}>*</span></label>
        <input type="text" className="form-control" id="Product" name="product" style={{marginLeft: '10px', width: '500px'}} />
        </div>
        
        
    </form>    
    
   )
}

export default Form;
